import { Link } from 'react-router-dom';
import React, { useEffect, useState } from 'react';
//import Shop from './pages/Shop';
//import { BrowserRouter, Routes, Route, Link } from "react-router-dom"; /api/search_product/2/
import { TextField, Button, Box, Typography } from '@mui/material';

function App() {

  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');

  return (

    <div className='bg-gradient-to-r from-blue-900 to-slate-900 min-h-screen'>


      <div className='text-center  text-white py-10'>
        <h1 className=' font-light text-5xl'>ODA LEARING</h1>
        <h2 className=' font-light text-2xl'>Menu dei fetch dal backend</h2>
      </div>


      <div className="text-center text-3xl grid grid-cols-1 md:grid-cols-3 gap-4 justify-items-center 
      items-center py-28">

        <Box
      component="form"
      onSubmit={handleSubmit}
      sx={{ display: 'flex', flexDirection: 'column', maxWidth: 400, margin: 'auto', mt: 10 }}
    >
      <Typography variant="h5" mb={2}>Login</Typography>
      <TextField
        label="Email"
        type="email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        margin="normal"
        required
      />
      <TextField
        label="Password"
        type="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        margin="normal"
        required
      />
      <Button type="submit" variant="contained" sx={{ mt: 2 }}>
        Accedi
      </Button>
    </Box>



        <div className="font-light bg-white w-40 rounded-md py-2">
          <Link to="/note">POST  <br/> + <br/> GET '[ ]' </Link>
        </div>
        <div className="font-light bg-white w-40 rounded-md py-2">
          <Link to="/persona">GET</Link>
        </div>
        <div className="font-light bg-white w-40 rounded-md py-2">
          <Link to="/prodotto">DELETE</Link>
        </div>
      </div>

      <div className='py-0'></div>

    </div>

  );
}

export default App;
